import React from 'react';
import styled from 'styled-components'
import imgUser from "../../images/user.png"
import { FaMapMarkerAlt, FaEdit } from "react-icons/fa";
import {Link} from "react-router-dom";


const Button = styled(Link)`
background-color: #002337;
color: white;
  `

const Name = styled.h4`
font-weight: 700;
  `


export default () => {
    return (
        <div className="text-center">

            <img className="mt-4 rounded-circle w-50" src={imgUser} />
            <div>
                <Name>Joana Sousa</Name>
                <p> <FaMapMarkerAlt /> From <b> Aveiro, Portugal</b></p>
                <p className="mb-5"> Buddy since 2018 </p>
                <Button className="mt-5 p-3" to={"/"}>
                    <FaEdit /> Edit Information
                </Button>
            </div>
        </div>
    )

}
